import './App.css';
import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import Provider from './context/Provider';
import Home from './pages/Home';

function App() {
  return (
    <Provider>
    <div className="App">
      <Routes>
        <Route exact path="/" element={ Home }  />
      </Routes>
    </div>
    </Provider>
  );
}

export default App;
